import React, { useState, useEffect } from 'react';
import './StudentModal.css';

export default function StudentModal({ open, onClose, student, mode = 'details', onSave }) {
  const [form, setForm] = useState(student || {});

  useEffect(() => {
    setForm(student || {});
  }, [student]);

  if (!open) return null;

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = e => {
    e.preventDefault();
    if (onSave) onSave(form);
  };

  return (
    <div className="student-modal-overlay">
      <div className="student-modal">
        <button className="modal-close" onClick={onClose}>×</button>
        {mode === 'details' ? (
          <div>
            <h2>Détails de l'étudiant</h2>
            <p><b>Apogée :</b> {student.code_apogee}</p>
            <p><b>Nom :</b> {student.nom}</p>
            <p><b>Prénom :</b> {student.prenom}</p>
            <p><b>Département :</b> {student.departement}</p>
            <p><b>Filière :</b> {student.filiere}</p>
            <p><b>Groupe :</b> {student.groupe}</p>
            <p><b>Statut :</b> {student.statut}</p>
          </div>
        ) : (
          <form onSubmit={handleSubmit} className="student-form">
            <h2>Éditer l'étudiant</h2>
            <label>Apogée
              <input name="code_apogee" value={form.code_apogee || ''} onChange={handleChange} required />
            </label>
            <label>Nom
              <input name="nom" value={form.nom || ''} onChange={handleChange} required />
            </label>
            <label>Prénom
              <input name="prenom" value={form.prenom || ''} onChange={handleChange} required />
            </label>
            <label>Département
              <input name="departement" value={form.departement || ''} onChange={handleChange} />
            </label>
            <label>Filière
              <input name="filiere" value={form.filiere || ''} onChange={handleChange} />
            </label>
            <label>Groupe
              <input name="groupe" value={form.groupe || ''} onChange={handleChange} />
            </label>
            <label>Statut
              <select name="statut" value={form.statut || ''} onChange={handleChange}>
                <option value="actif">Actif</option>
                <option value="inactif">Inactif</option>
              </select>
            </label>
            <button type="submit">Enregistrer</button>
          </form>
        )}
      </div>
    </div>
  );
}
